// src/components/Debits.js

import React, {Component} from 'react';
import {Link} from 'react-router-dom';

class Debits extends Component{
    constructor(props){
        super(props);
        this.state = {
            apiData: {
              id: -1,
              description: "",
              amount: -1,
              date: "0000-00-00T00:00:00.000Z"
            },
            searchText: "",
            found: false
        }
    }



    render(){
        return(
            <div>
                <h1>
                    Debits
                </h1>
                <div>Debits</div>
                <Link to="/">Return to Home</Link>

            </div>
        );
    }
}

export default Debits;
